import React from 'react';
import OptionsBox from '../components/OptionsBox';
import EarthSection from '../components/EarthSection';
import Navbar from '../components/Navbar';
function Home() {
  return (
    <>

    <div className='container'>
    <Navbar/>
    <OptionsBox/>
    <EarthSection/>
    </div>

    </>

  );
}

export default Home;
